import React from "react";
import { useSwiper } from "swiper/react";

const Yair = ({ video }) => {
  const swiper = useSwiper();

  return (
    <button
      onClick={() => {
        video.ontimeupdate = function () {
          console.log(video.currentTime);
          if (video.currentTime > 5.0) {
            swiper.slideNext();
            console.log(video.currentTime);
          }
        };
      }}
    >
      testing
    </button>
  );
};

export default Yair;
